import React from 'react';
import './App.css';
import{Link} from 'react-router-dom'

function Nav() {
    const navStyle = {
        color: 'white'
    };

  return (
    <div className="nav">
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link style={nav}to="/about">
                    <li>About</li>
                </Link>
                <Link to="/menu">
                    <li>Menu</li>
                </Link>

                <Link to="/login">
                    <li>Login</li>
                </Link>
                <Link to="/signup">
                    <li>SignUp</li>
                </Link>
            </ul>
        </nav>
    </div>
  );
}

export default Nav;
